import axios from "axios";
import { useEffect, useState } from "react";
import { Container } from "react-bootstrap";
import { useParams } from "react-router-dom";

interface ArticleDS {
    _id: string,
    title: string,
    imageUrl: string,
    content: string
}

const ArticleView = () => {
    const [articles, setArticles] = useState<ArticleDS[]>([]);

    const { articleid } = useParams();

    console.log(articleid)

    useEffect(() => {
        fetchArticles();
    }, [])
    const fetchArticles = async () => {
        const { data: response } = await axios.get("http://localhost:5000/articles");
        setArticles(response);        
    }

    return <Container>{articles.map(article => (
        article._id === articleid ? (<Container>{article.title}</Container>) : (<></>)
    ))}</Container>

}

export default ArticleView;
